"use strict";$(document).ready(function(){$.getJSON("/data/index.json",function(e){var t=elasticlunr.Index.load(e),r=window.location.search.replace("?","").split("=");if("query"==r[0]){var n=decodeURIComponent(r[1].replace("+"," ")),s=t.search(n);if(s.length>0){$("#results").show();var o=$("#result-template").html();Mustache.parse(o);var a=$("#results-list");$("#results-count").text(s.length);for(var l=0;l<s.length;l++){var c=t.documentStore.docs[s[l].ref];a.append(Mustache.render(o,c))}highlightContent(window.location.href)}else $("#no-results").show()}})});